import React from 'react';
import NavbarAfterLogin from './NavbarAfterLogin'; // Custom navbar after login for tenant
import Footer from './Footer'; // Reusing the same footer

const TenantDashboardLayout = () => {
    return (
        <div>
            <NavbarAfterLogin />
            <div className="dashboard-content">
                {/* Your tenant dashboard content here */}
                <h1>Welcome to the Tenant Dashboard</h1>
            </div>
            <Footer />
        </div>
    );
};

export default TenantDashboardLayout;
